import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 13.1-1244 Name.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1244.md","filePath":"vacode/13.1-1244.md"}'),i={name:"vacode/13.1-1244.md"},s=r('<h1 id="§-13-1-1244-name" tabindex="-1">§ 13.1-1244 Name. <a class="header-anchor" href="#§-13-1-1244-name" aria-label="Permalink to &quot;§ 13.1-1244 Name.&quot;">​</a></h1><p>A. No certificate of registration shall be issued to a foreign business trust unless the name of such foreign business trust satisfies the requirements of § <a href="http://law.lis.virginia.gov/vacode/13.1-1214/" target="_blank" rel="noreferrer">13.1-1214</a>.</p><p>B. If the name of a foreign business trust does not satisfy the requirements of § <a href="http://law.lis.virginia.gov/vacode/13.1-1214/" target="_blank" rel="noreferrer">13.1-1214</a>, to obtain or maintain a certificate of registration to transact business in the Commonwealth, the foreign business trust may use a designated name that is available, and which satisfies the requirements of § <a href="http://law.lis.virginia.gov/vacode/13.1-1214/" target="_blank" rel="noreferrer">13.1-1214</a>, if it informs the Commission of the designated name.</p><p>2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0621" target="_blank" rel="noreferrer">621</a>; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0063" target="_blank" rel="noreferrer">63</a>.</p>',4),n=[s];function o(f,l,c,h,_,d){return a(),t("div",null,n)}const u=e(i,[["render",o]]);export{g as __pageData,u as default};
